import React, { Component }  from 'react';
import {connect} from 'react-redux'


class Form extends Component {

    render(){ 
        const {data} = this.props.data
        return(
            <select>
                <option 
                    key="new-product"
                    value="new-product">
                new product
                </option>
                {data.map(item => 
                    <option 
                        key={item.id} 
                        value={item.id}>
                    {item.id}
                    </option>
                )}

            </select>
        )
    }
}

const mapStateToProps  = (state) => ({
    data: state.products,
})

export default connect(mapStateToProps, {})(Form)
